import { Route} from 'react-router-dom';

function ProtectedRoutes(Props) {


    let tempValidityCheck=false;
    if(tempValidityCheck){
     return <Route exact path="/Login" component={Props.Login}></Route>
    }
}

export default ProtectedRoutes;
